const getInfoDataTranscriptions = (state) => {
  return state.transcriptionsData
}
const getInfoDataErrorMessage = (state) => {
  return state.errorMessage
}

export default {
  getInfoDataTranscriptions,
  getInfoDataErrorMessage
}
